const a={a1:"材料自身有一些固定的特性和行为。",a2:"了解材料的这些特性，会有助于你用一种和 Material Design 的构想更一致的方式来使用材料。",a3:"材料的特性",a4:"固体的",a5:"在空间中占据一个独一无二的位置",a6:"不可穿透",a7:"形状可变",a8:"仅允许沿着当前所在平面改变大小",a9:"坚硬的",a10:"可以添加到其他材料中",a11:"可以独立、分割和复原",a12:"可以被创建和销毁",a13:"可以在任何轴上移动",a14:"物理属性",a15:"材料的转换",a16:"材料的移动",a17:"材料在 <strong>x、y 轴上有不同的尺寸</strong>（计量单位为 dp）和<strong>统一的厚度</strong>（1dp）。",a18:"材料的长度和宽度是可以改变的。",a19:"所有材料都是 1dp 的厚度。",a20:"材料会投射出阴影。",a21:"阴影是由于元素之间的相对高度（Z 轴）而自然产生的。",a22:"阴影反映了材料的元素之间的相对高度。",a23:"阴影不是通过对材料着色产生的。",a24:"内容可以以任何形状和颜色显示在材料上。内容不会增加材料的厚度。",a25:"材料可以展示任何形状和颜色。",a26:"内容看起来可以独立于材料，但是会被限制在材料的边界内。",a27:"内容的行为可以和材料的行为互相独立。",a28:"材料是固态的。",a29:"输入事件不能穿透材料。",a30:"只有在最前面的材料才会响应输入事件。",a31:"输入事件不能穿透材料。",a32:"多个材料元素不能同时出现在同一空间中的相同位置。",a33:"利用高度来区分材料元素，以防止多个材料元素同时占用空间中的相同位置。",a34:"多个材料元素不能同时占用空间中的相同位置。",a35:"材料之间不能相互交叉。",a36:"例如，当改变材料高度时，这片材料不能从另一片材料中穿过。",a37:"材料之间不能相互交叉。",a38:"材料可以改变形状。",a39:"材料只能在当前所在平面内伸缩。",a40:"材料不能弯曲或折叠。",a41:"多片材料可以组合成一片材料。",a42:"多片材料可以组合成一片材料。",a43:"分割之后，材料可以复原。例如，如果你从一片材料中移动了其中一部分，这部分材料会重新回到那片材料中，恢复成一整片材料。",a44:"材料可以被分割和复原。",a45:"材料可以在环境中的任何地方自动创建或销毁。",a46:"材料可以自动创建或销毁。",a47:"材料可以沿着任何轴移动。",a48:"材料可以沿着任何轴移动。",a49:"Z 轴的运动通常是用户和材料交互的结果。",a50:"Z 轴的运动是用户和材料交互后产生的。",a51:"Material Design 中材料的特性和行为解析",a52:"Material Design 中，材料的长度和宽度可调整",a53:"Material Design 中，所有材料厚度为 1dp",a54:"Material Design 中，只有最前面的材料响应输入事件",a55:"Material Design 中，输入事件不能穿透",a56:"利用高度区分 Material Design 元素，避免重叠",a57:"多个 Material Design 元素不能重叠"};export{a as zhCn};
